module LibClient.Icons

open ReactXP.SVG
open ReactXP.Styles

type IconConstructor = Color -> int -> Icon

// To convert SVG polygons to paths, use (installable through npm)
// `svgo --pretty --config='{"full": true}' --enable=convertShapeToPath -o - path/to/file.svg`

// Generic icons go here, project-specific icons go into a project-specific superclass of this
and Icon =
    interface Fable.React.ReactElement

    static member (* protected *) MakeIcon (viewboxDimensions: int * int) (size: int) (children: array<Fable.React.ReactElement>) : Icon =
        let (viewboxWidth, viewboxHeight) = viewboxDimensions
        ImageSvg
            {|
                height  = size
                width   = size
                viewBox = sprintf "0 0 %i %i" viewboxWidth viewboxHeight
            |}
            children
        :> obj :?> Icon

    static member (* protected *) MakeSvgPathIcon (viewboxDimensions: int * int) (pathDs: array<string>) (color: Color) (size: int) : Icon =
        pathDs
        |> Array.map (fun d -> SvgPath {| fillColor = color.ToReactXPString; d = d |} [||])
        |> Icon.MakeIcon viewboxDimensions size

